            {record.content}
          </div>
        </Tooltip>

      ),

    },
    {
      title: '日期',
      dataIndex: 'created_at',
      key: 'created_at',
      width: 200,
      align: 'center'
    },
    {
      title: 'AI',
      dataIndex: 'isAe',
      key: 'isAe',
      width: 70,
      align: 'center'
    },
